import React, { useEffect } from "react";

const CheeseCornPizza = () => {
  useEffect(() => {
    // Draw Pizza - Enhanced with Cheese and Corn Toppings
    const pizzaCanvas = document.getElementById("pizzaCanvas");
    const pizzaCtx = pizzaCanvas.getContext("2d");

    // Pizza Base (Dough)
    pizzaCtx.fillStyle = "#e2b97f"; // Dough color
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 80, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Pizza Crust (Thick golden crust)
    pizzaCtx.fillStyle = "#d68f3b";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 90, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Tomato Sauce
    pizzaCtx.fillStyle = "#d93d3d";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 75, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Cheese Layer (Extra cheese for cheese corn pizza)
    pizzaCtx.fillStyle = "#f9d75c";
    pizzaCtx.beginPath();
    pizzaCtx.arc(100, 100, 70, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Extra Cheese Strands
    pizzaCtx.strokeStyle = "#f7e685";
    pizzaCtx.lineWidth = 2;
    pizzaCtx.beginPath();
    pizzaCtx.moveTo(80, 90);
    pizzaCtx.lineTo(120, 110);
    pizzaCtx.stroke();

    pizzaCtx.beginPath();
    pizzaCtx.moveTo(110, 90);
    pizzaCtx.lineTo(90, 110);
    pizzaCtx.stroke();

    // Corn Kernels (Cheese Corn Pizza Topping)
    pizzaCtx.fillStyle = "#ffeb3b"; // Corn yellow
    pizzaCtx.beginPath();
    pizzaCtx.arc(50, 70, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(150, 70, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(80, 140, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 140, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 160, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(140, 160, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Mushrooms (Realistic texture)
    pizzaCtx.fillStyle = "#a68f62"; // Mushrooms
    pizzaCtx.beginPath();
    pizzaCtx.arc(120, 110, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(60, 120, 8, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Black Olives
    pizzaCtx.fillStyle = "#4d4d4d"; // Black Olives
    pizzaCtx.beginPath();
    pizzaCtx.arc(90, 80, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    pizzaCtx.beginPath();
    pizzaCtx.arc(110, 120, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Onions (Sliced thin)
    pizzaCtx.fillStyle = "#f5b82d"; // Onions
    pizzaCtx.beginPath();
    pizzaCtx.arc(70, 100, 6, 0, 2 * Math.PI);
    pizzaCtx.fill();

    // Draw the cheese corn pizza canvas and styling
  }, []);

  return (
    <div style={styles.container}>
      <h2 style={styles.heading}>Cheese Corn Pizza</h2>
      <div style={styles.canvasContainer}>
        <canvas id="pizzaCanvas" width="200" height="200" style={styles.canvas}></canvas>
      </div>
    </div>
  );
};

const styles = {
  container: {
    textAlign: "center",
    padding: "20px",
    background: "linear-gradient(135deg, #ffe5d9, #fbd9e1)",
    borderRadius: "10px",
    boxShadow: "0px 4px 8px rgba(0, 0, 0, 0.2)",
    maxWidth: "500px",
    margin: "auto",
  },
  heading: {
    color: "#f04e8c",
    fontFamily: "'Poppins', sans-serif",
    marginBottom: "20px",
    fontSize: "24px",
  },
  canvasContainer: {
    display: "flex",
    justifyContent: "center",
    gap: "30px",
  },
  canvas: {
    border: "3px solid #f04e8c",
    borderRadius: "10px",
    backgroundColor: "#ffffff",
  },
};

export default CheeseCornPizza;
